       <h5 class="card-title">1º Objectivo</h5>
       <p class="card-text">Promover a Agricultura Local: Queremos fortalecer as comunidades agrícolas locais, conectando-as diretamente aos consumidores. Ao apoiar os agricultores locais, estamos incentivando uma economia mais justa e sustentável.</p>
       <h5 class="card-title">2º Objectivo</h5>   
       <p class="card-text">Oferecer Produtos Frescos e de Qualidade: Buscamos garantir que cada produto em nosso site atenda aos mais altos padrões de qualidade. Trabalhamos em estreita colaboração com produtores cuidadosamente selecionados para garantir que você receba alimentos frescos e saudáveis em cada pedido.</p>
